import React from "react";
import Ticker from "./Ticker";
import GridLayout from "react-grid-layout";

const TickersCopy = ({ tickers, onDelete }) => {
  console.log(tickers);

  const ticks = () => {
    console.log("p")
    tickers.map((ticker) => {
      return (
        <div style={{ backgroundColor: "grey" }} data-grid={{ x: ticker.id, y: 0, w: 1, h: 2 }}>
          <Ticker
            key={ticker.id}
            ticker={ticker}
            onDelete={() => onDelete(ticker.id)}
          >
            {ticker.tickername}
          </Ticker>
        </div>
      )
    })
  }


  return (
    <>
      {/* {tickers.map((ticker) => (
        <Ticker
          key={ticker.id}
          ticker={ticker}
          onDelete={() => onDelete(ticker.id)}
        >
          {ticker.tickername}
        </Ticker>
      ))} */}
      <GridLayout className="layout" cols={12} rowHeight={30} width={1200}>{ticks}</GridLayout>
      <GridLayout className="layout" cols={12} rowHeight={30} width={1200}>
        <div key="a" style={{ backgroundColor: "grey" }} data-grid={{ x: 0, y: 0, w: 2, h: 6 }}>a</div>
        <div key="b" style={{ backgroundColor: "grey" }} data-grid={{ x: 1, y: 0, w: 3, h: 2, minW: 2, maxW: 4 }}>b</div>
        <div key="c" style={{ backgroundColor: "grey" }} data-grid={{ x: 4, y: 0, w: 1, h: 2 }}>c</div>
      </GridLayout>
    </>
  );
};

export default TickersCopy;
